//import React from 'react';
import './Header.min.css';
import { FaDumbbell } from 'react-icons/fa';
import { AiOutlineHome } from 'react-icons/ai';
import { Link } from 'react-router-dom';
import { useState, useEffect } from 'react';


export const Header = () => {
  const [user, setUser] = useState({});

  useEffect(() => {

        setInterval(() => {
            const userString = localStorage.getItem("user");
            const user = JSON.parse(userString!);
            setUser(user);
          }, 5000)
    }, []);

    const logout = () => {
        return localStorage.removeItem("user");
    }

    if(!user) {
      return (
        <header id = "wrapper">
          <Link to = "/" className = 'link'><h1 className = "headerH1"><span>Fit</span>ify <FaDumbbell /></h1></Link>
                <nav>
                  <ul id = "nav_links">
                    <li id = "home">
                      <Link to = "/" className = 'link'><AiOutlineHome id = 'house' />Home</Link>
                    </li>
                    <li className = "rest">
                      <Link to = "/login" className = 'link'>Login</Link>
                    </li>
                    <li className = "rest">
                      <Link to = "/register" className = 'link'>Sign Up</Link>
                    </li>
                    <li className = "rest">Stats</li>
                    <li className = "rest">Leaderboards</li>
                    <li className = "rest">Activities</li>
                  </ul>
                </nav>
        </header>
      );
    }

    if (user) {
      return (
        <header id = "wrapper">
          <Link to = "/" className = 'link'><h1 className = "headerH1"><span>Fit</span>ify <FaDumbbell /></h1></Link>
                <nav>
                  <ul id = "nav_links">
                    <li id = "home">
                      <Link to = "/" className = 'link'><AiOutlineHome id = 'house' />Home</Link>
                    </li>
                    <li className = "rest">
                      <Link to = "/" className = 'link'>{user}</Link>
                    </li>
                    <li className = "rest">
                      <Link to = "/" className = 'link' onClick = {logout}>Logout</Link>
                    </li>
                    <li className = "rest">Stats</li>
                    <li className = "rest">Leaderboards</li>
                    <li className = "rest">Activities</li>
                  </ul>
                </nav>
        </header>
      );
    }
}
